// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;

contract structs {
    enum UserType {
        PRESIDENT,
        VICE_PRESIDENT,
        TREASURER,
        MEMBER,
        NONE,
        ADMIN
    }

    enum Gender {
        MALE,
        FEMALE,
        OTHER
    }

    enum RequestStatus {
        APPROVED,
        COMPLETED,
        REJECTED,
        IN_PROCESS
    }

    struct User {
        uint256 id;
        string name;
        string aadhar;
        uint256 mobno;
        string fatherName;
        address walletAddress;
        uint256[] loansTaken;
        uint256[] requests;
        uint256 shgid;
        UserType userType;
        Gender gender;
        Location location;
    }

    struct Location {
        string state;
        string district;
        string blockName;
        string panchyatName;
        string villageName;
    }

    struct Bank {
        uint256 id;
        string name;
        address walletAddress;
        string code;
        uint256 intrestRate;
        uint256[] requests;
    }

    struct SHG {
        uint256 id;
        uint256[] users;
        string name;
        Location location;
        string dateOfFormation;
        uint256 currentBalance;
        uint256 owedBalance;
        uint256[] loansGiven;
        uint256[] loansTaken;
        uint256 baseIntrest;
    }

    struct Loan {
        uint256 loanId;
        uint256 lenderId;
        uint256 amount;
        uint256 lendeeId;
        uint256 intrest;
        uint256 loanTime;
        uint256 date;
        uint256 lastEMI;
    }

    struct Status {
        RequestStatus requestStatus;
        uint256 Id;
    }

    struct UserRequest {
        uint256 requestId;
        uint256 userId;
        uint256 amount;
        string description;
        uint256 SHGId;
        RequestStatus status;
        uint256 loanTime;
        uint256[] approvals;
    }

    struct SHGRequest {
        uint256 requestid;
        uint256 shgid;
        uint256 amount;
        uint256 loanTime;
        RequestStatus status;
    }

    mapping(uint256 => User) public users;
    mapping(uint256 => SHG) public shgs;
    mapping(string => uint256[]) public districtToSHGs;
    mapping(uint256 => Bank) public banks;

    mapping(address => uint256) public addressToUser;
    mapping(uint256 => Loan) public loans;
    mapping(uint256 => UserRequest) public userRequests;
    mapping(uint256 => SHGRequest) public shgRequests;

    // Login
    mapping(address => uint256) public addressToSHGid;
    mapping(address => uint256) public addressToBankid;

    // fetch
    mapping(uint256 => uint256[]) public userToRequests;
    mapping(uint256 => uint256[]) public shgToRequests;

    uint256 numUsers;
    uint256 numSHGs;
    uint256 numUserRequests;
    uint256 numSHGRequests;
    uint256 numBanks;
    uint256 numLoans;
}
